import{_ as e}from"./chunks/v5__01.BYtbY4Vm.js";import{a as t,b as a,c as o,_ as r,d as l,e as i}from"./chunks/v5__quickstart_07.DFnbisE-.js";import{_ as s,c as n,o as c,ab as h}from"./chunks/framework.CUflZczI.js";const w=JSON.parse('{"title":"CUAV V5+ 快速接线指南","description":"","frontmatter":{},"headers":[],"relativePath":"zh/assembly/quick_start_cuav_v5_plus.md","filePath":"zh/assembly/quick_start_cuav_v5_plus.md"}'),d={name:"zh/assembly/quick_start_cuav_v5_plus.md"},u=h('<h1 id="cuav-v5-快速接线指南" tabindex="-1">CUAV V5+ 快速接线指南 <a class="header-anchor" href="#cuav-v5-快速接线指南" aria-label="Permalink to &quot;CUAV V5+ 快速接线指南&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>This quick start guide shows how to power the <a href="./../flight_controller/cuav_v5_plus.html">CUAV V5+</a> flight controller and connect its most important peripherals.</p><p><img src="'+e+'" alt="V5+ AutoPilot - Hero Image"></p><h2 id="接线图概述" tabindex="-1">接线图概述 <a class="header-anchor" href="#接线图概述" aria-label="Permalink to &quot;接线图概述&quot;">​</a></h2><p>The image below shows how to connect the most important sensors and peripherals (except the motor and servo outputs). We&#39;ll go through each of these in detail in the following sections.</p><p><img src="'+t+'" alt="V5+ AutoPilot"></p><table><thead><tr><th style="text-align:left;">主要接口</th><th style="text-align:left;">功能</th></tr></thead><tbody><tr><td style="text-align:left;">Power1</td><td style="text-align:left;">连接到电源模块（电流计）。 Power input with <em>analog</em> voltage and current detection. 请不要连接数字电源模块（比如UAVCAN电流计）！</td></tr><tr><td style="text-align:left;">Power2</td><td style="text-align:left;">连接I2C总线的智能电池</td></tr><tr><td style="text-align:left;">TF CARD</td><td style="text-align:left;">用于日志存储的SD卡（出厂时SD已经装配好）。</td></tr><tr><td style="text-align:left;">M1~M8</td><td style="text-align:left;">PWM输出接口 可以使用它控制电机或舵机。</td></tr><tr><td style="text-align:left;">A1~A6</td><td style="text-align:left;">PWM 输出接口。 可以使用它控制电机或舵机。</td></tr><tr><td style="text-align:left;">DSU7</td><td style="text-align:left;">用于FMU调试，读取调试信息。</td></tr><tr><td style="text-align:left;">I2C1/I2C2</td><td style="text-align:left;">连接I2C总线设备；比如外部指南针。</td></tr><tr><td style="text-align:left;">CAN1/CAN2</td><td style="text-align:left;">用于连接UAVCAN设备,比如CAN GPS。</td></tr><tr><td style="text-align:left;">TYPE-C(USB)</td><td style="text-align:left;">用于连接计算机，建立飞行控制器和计算机之间的通信；比如刷写固件。</td></tr><tr><td style="text-align:left;">SBUS OUT</td><td style="text-align:left;">连接SBUS总线控制的相机和云台</td></tr><tr><td style="text-align:left;">GPS&amp;SAFETY</td><td style="text-align:left;">连接到Neo GPS，其中包括GPS、安全开关、蜂鸣器接口。</td></tr><tr><td style="text-align:left;">TELEM1/TELEM2</td><td style="text-align:left;">连接到数传电台</td></tr><tr><td style="text-align:left;">DSM/SBUS/RSSI</td><td style="text-align:left;">包含DSM、SBUS、RSSI信号输入接口；DSM接口可以连接DSM卫星接收机，SBUS接口可以连接SBUS总线的遥控器接收机，RSSI连接RSSI信号强度回传模块。</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">For more interface information, please read <a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">V5+ Manual</a>.</p></div><p><img src="'+t+'" alt="V5+ AutoPilot"></p><div class="info custom-block"><p class="custom-block-title">If the controller cannot be mounted in the recommended/default orientation (e.g. due to space constraints) you will need to configure the autopilot software with the orientation that you actually used: <a href="./../gps_compass/rtk_gps.html">Flight Controller Orientation</a>.</p></div><h2 id="gps-罗盘-安全开关-led" tabindex="-1">GPS + 罗盘 + 安全开关 + LED <a class="header-anchor" href="#gps-罗盘-安全开关-led" aria-label="Permalink to &quot;GPS + 罗盘 + 安全开关 + LED&quot;">​</a></h2><p>The recommended GPS module is the <em>Neo v2 GPS</em>, which contains GPS, compass, safety switch, buzzer, LED status light.</p><div class="info custom-block"><p class="custom-block-title">Other GPS modules may not work (see <a href="./../flight_controller/cuav_v5_nano.html#compatibility_gps">this compatibility issue</a>)).</p></div><p>The GPS/Compass module should be <a href="./../assembly/mount_gps_compass.html">mounted on the frame</a> as far away from other electronics as possible, with the direction marker towards the front of the vehicle (<em>Neo v2 GPS</em> arrow is in the same direction as the flight control arrow). Connect to the flight control GPS interface using a cable.</p><div class="info custom-block"><p class="custom-block-title">If you use the <a href="http://doc.cuav.net/gps/neo-series-gnss/en/neo-v2-pro.html" target="_blank" rel="noreferrer">NEO V2 PRO GNSS (CAN GPS)</a>, please use the cable to connect to the flight control CAN interface.</p></div><p><img src="'+a+'" alt="V5+ AutoPilot"></p><h2 id="安全开关" tabindex="-1">安全开关 <a class="header-anchor" href="#安全开关" aria-label="Permalink to &quot;安全开关&quot;">​</a></h2><p>The dedicated safety switch that comes with the V5+ is only required if you are not using the recommended <em>Neo V2 GPS</em> (which has an inbuilt safety switch).</p><p>If you are flying without the GPS you must attach the switch directly to the <code>GPS1</code> port in order to be able to arm the vehicle and fly (if you use the old 6-pin GPS, please read the definition of the bottom interface to change the line).</p><h2 id="蜂鸣器" tabindex="-1">蜂鸣器 <a class="header-anchor" href="#蜂鸣器" aria-label="Permalink to &quot;蜂鸣器&quot;">​</a></h2><p>If you do not use the recommended GPS, the buzzer may not work.</p><h2 id="遥控器" tabindex="-1">遥控器 <a class="header-anchor" href="#遥控器" aria-label="Permalink to &quot;遥控器&quot;">​</a></h2><p>A remote control (RC) radio system is required if you want to manually control your vehicle (PX4 does not require a radio system for autonomous flight modes). You will need to select a compatible transmitter/receiver and then bind them so that they communicate (read the instructions that come with your specific transmitter/receiver).</p><p>The figure below shows how you can access your remote receiver (please find the SBUS cable in the kit).</p><p><img src="'+o+'" alt="V5+ AutoPilot"></p><h2 id="spektrum-卫星接收器" tabindex="-1">Spektrum 卫星接收器 <a class="header-anchor" href="#spektrum-卫星接收器" aria-label="Permalink to &quot;Spektrum 卫星接收器&quot;">​</a></h2><p>The V5+ has a dedicated DSM cable. If using a Spektrum satellite receiver, this should be connected to the flight controller DSM/SBUS/RSSI interface.</p><h2 id="电源" tabindex="-1">电源 <a class="header-anchor" href="#电源" aria-label="Permalink to &quot;电源&quot;">​</a></h2><p>The V5+ kit includes the <em>HV_PM</em> module, which supports 2~14S LiPo batteries. Connect the 6pin connector of the <em>HW_PM</em> module to the flight control <code>Power1</code> interface.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The supplied power module is unfused. Power <strong>must</strong> be turned off while connecting peripherals.</p></div><p><img src="'+r+'" alt="V5+ AutoPilot"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The power module is not a power source for peripherals connected to the PWM outputs. If you&#39;re connecting servos/actuators you will need to separately power them using a BEC.</p></div><h2 id="telemetry-system-optional" tabindex="-1">Telemetry System (Optional) <a class="header-anchor" href="#telemetry-system-optional" aria-label="Permalink to &quot;Telemetry System (Optional)&quot;">​</a></h2><p>A telemetry system allows you to communicate with, monitor, and control a vehicle in flight from a ground station (for example, you can direct the UAV to a particular position, or upload a new mission).</p><p>The communication channel is via Telemetry Radios. The vehicle-based radio should be connected to either the <code>TELEM1</code> or <code>TELEM2</code> port (if connected to these ports, no further configuration is required). The other radio is connected to your ground station computer or mobile device (usually via USB).</p><p><img src="'+l+'" alt="V5+ AutoPilot"></p><p><a id="sd_card"></a></p><h2 id="sd-卡" tabindex="-1">SD 卡 <a class="header-anchor" href="#sd-卡" aria-label="Permalink to &quot;SD 卡&quot;">​</a></h2><p>An <a href="./../getting_started/px4_basic_concepts.html#sd-cards-removable-memory">SD card</a> is inserted in the factory (you do not need to do anything).</p><h2 id="电机" tabindex="-1">电机 <a class="header-anchor" href="#电机" aria-label="Permalink to &quot;电机&quot;">​</a></h2><p>Motors/servos are connected to the MAIN and AUX ports in the order specified for your vehicle in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><p><img src="'+i+'" alt="V5+ AutoPilot"></p><h2 id="针脚定义" tabindex="-1">针脚定义 <a class="header-anchor" href="#针脚定义" aria-label="Permalink to &quot;针脚定义&quot;">​</a></h2><p>Download <strong>V5+</strong> pinouts from <a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">here</a>.</p><h2 id="更多信息" tabindex="-1">更多信息 <a class="header-anchor" href="#更多信息" aria-label="Permalink to &quot;更多信息&quot;">​</a></h2><ul><li><a href="./../frames_multicopter/dji_f450_cuav_5plus.html">Airframe build-log using CUAV v5+ on a DJI FlameWheel450</a></li><li><a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">CUAV V5+ Manual</a> (CUAV)</li><li><a href="http://doc.cuav.net/flight-controller/v5-autopilot/en/v5+.html" target="_blank" rel="noreferrer">CUAV V5+ docs</a> (CUAV)</li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a> (CUAV)</li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a> (CUAV)</li><li><a href="https://github.com/cuav/hardware/tree/master/V5_Autopilot/V5%2B/V5%2BBASE" target="_blank" rel="noreferrer">Base board design reference</a> (CUAV)</li></ul>',47),p=[u];function m(f,g,_,b,y,S){return c(),n("div",null,p)}const A=s(d,[["render",m]]);export{w as __pageData,A as default};
